function wordSubsets(words1: string[], words2: string[]): string[] {
    let universalWords: string[] = [];
    words2 = Array.from(new Set<string>(words2.map(x => x.split('').sort().join(''))));

    for (let i = 0; i < words1.length; i++) {
        const word1: string = words1[i];
        // console.log(`outer loop starts: word1 is ${word1}`)

        let isUniversal: boolean = true;
        for (let j = 0; j < words2.length; j++) {
            let word1Temp: string = word1;
            let word2: string[] = words2[j].split('');
            // console.log(`  inner loop starts: word2 is ${word2}`)
            while (word2.length > 0) {
                let c = word2.pop();
                if (!word1Temp.includes(c)) {
                    // console.log(`    ${word1Temp} does NOT include ${c}`)
                    isUniversal = false;
                    break;
                } else {
                    word1Temp = word1Temp.replace(c, '');
                    // console.log(`    trimmed word1Temp to ${word1Temp}`)
                }
            }

            if (!isUniversal) {
                break;
            }
        }

        if (isUniversal) {
            universalWords.push(word1);
        }
    }

    return universalWords;
};

